export const STORE_RESTAURANTS = "STORE_RESTAURANTS";

export const loadRestaurants = () => (disspatch, getState, api) => {
  api.loadRestaurants().then((records) => {
    dispatch(storeRestaurants(records));
  });
};

const storeRestaurants = (records) => ({});
